import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

function QuanLyCongDan() {
  const [congDanList, setCongDanList] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');

  // Hàm gọi API để lấy danh sách công dân
  const fetchCongDan = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/congdan');
      setCongDanList(response.data);
    } catch (error) {
      console.error("Lỗi khi tải danh sách công dân:", error);
      alert('Không thể tải danh sách công dân.');
    }
  };

  // Tự động tải danh sách khi component được render lần đầu
  useEffect(() => {
    fetchCongDan();
  }, []);

  // Hàm xử lý tìm kiếm
  const handleSearch = async (e) => {
    e.preventDefault();
    if (!searchTerm.trim()) {
        fetchCongDan(); // Nếu ô tìm kiếm trống thì tải lại toàn bộ danh sách
        return;
    }
    try {
      const response = await axios.get(`http://localhost:5000/api/congdan/search?term=${searchTerm}`);
      setCongDanList(response.data);
    } catch (error) {
      console.error("Lỗi khi tìm kiếm:", error);
      alert('Không tìm thấy kết quả.');
    }
  };

  return (
    <div>
      <h2 className="content-header">Danh sách Công dân</h2>

      {/* Form tìm kiếm */}
      <form onSubmit={handleSearch} style={{ marginBottom: '20px', display: 'flex', gap: '10px' }}>
        <input
          type="text"
          placeholder="Nhập họ tên hoặc CCCD để tìm kiếm..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          style={{ flexGrow: 1, padding: '10px' }}
        />
        <button type="submit" className="submit-button" style={{ width: 'auto' }}>Tìm kiếm</button>
      </form>

      {/* Bảng hiển thị danh sách */}
      <table style={{ width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          <tr style={{ backgroundColor: '#f2f2f2' }}>
            <th style={tableHeaderStyle}>Số CCCD</th>
            <th style={tableHeaderStyle}>Họ và Tên</th>
            <th style={tableHeaderStyle}>Năm Sinh</th>
            <th style={tableHeaderStyle}>Giới Tính</th>
            <th style={tableHeaderStyle}>Tình Trạng Hôn Nhân</th>
            <th style={tableHeaderStyle}>Hành động</th>
          </tr>
        </thead>
        <tbody>
          {congDanList.map((congDan) => (
            <tr key={congDan.so_cccd} style={tableRowStyle}>
              <td style={tableCellStyle}>{congDan.so_cccd}</td>
              <td style={tableCellStyle}>{congDan.ho_ten}</td>
              <td style={tableCellStyle}>{congDan.nam_sinh}</td>
              <td style={tableCellStyle}>{congDan.gioi_tinh}</td>
              <td style={tableCellStyle}>{congDan.tinh_trang_hon_nhan}</td>
              <td style={tableCellStyle}>
                <Link to={`/cong-dan/${congDan.so_cccd}`}>Xem chi tiết</Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

// CSS cho bảng
const tableHeaderStyle = {
  padding: '12px',
  textAlign: 'left',
  borderBottom: '1px solid #ddd',
};

const tableCellStyle = {
  padding: '12px',
  borderBottom: '1px solid #ddd',
};

const tableRowStyle = {
    borderBottom: '1px solid #ddd',
};

export default QuanLyCongDan;
